import React from 'react';
import Admin_layout from '../../pages/admin_layout';

const Demo = ({ data, categories, cartAdmin }) => {
	const section = <>
						<h1>DASHBOARD</h1>
						<button type="button" className="btn btn-primary p-5">
							<label>Số category đã đươc tạo: {categories.length}</label>
						</button>
					</>
	return (
		<div>
			<Admin_layout section={section} />
		</div>
	)
}

export default Demo
